import { Injectable } from '@angular/core';

@Injectable({
  providedIn: 'root'
})
export class EmpformserviceService {

  constructor(private http:HttpClient) { }


  baseUrl = "http://localhost:3000"

  submitapi(a:any,b:any,c:any){
    return this.http.post(this.baseUrl+"/signupEmp/",a,b,c);
  }


}
